import { useDispatch, useSelector } from "react-redux";
import LogItem from "./LogItem";


const AllLogs = () => {
    var alllogs = useSelector(state => state.logs.logs)

    return (
        <div>
            {alllogs.map((log, index) => <LogItem log = {log} key = {index} />)}
        </div>
    );
};

export default AllLogs;
